create table Child
(
    Id                              uniqueidentifier                                   not null
        constraint PK_Child
            primary key,
    AuthorId                        int,
    Sasid                           nvarchar(max),
    FirstName                       nvarchar(35)                                       not null,
    MiddleName                      nvarchar(35),
    LastName                        nvarchar(35)                                       not null,
    Suffix                          nvarchar(10),
    Birthdate                       date,
    BirthTown                       nvarchar(max),
    BirthState                      nvarchar(max),
    BirthCertificateId              nvarchar(max),
    AmericanIndianOrAlaskaNative    bit                                                not null,
    Asian                           bit                                                not null,
    BlackOrAfricanAmerican          bit                                                not null,
    NativeHawaiianOrPacificIslander bit                                                not null,
    White                           bit                                                not null,
    HispanicOrLatinxEthnicity       bit,
    Gender                          int                                                not null,
    Foster                          bit                                                not null,
    FamilyId                        int,
    OrganizationId                  int,
    SysStartTime                    datetime2(0)
        constraint Child_SysStart default sysutcdatetime()                             not null,
    SysEndTime                      datetime2(0)
        constraint Child_SysEnd default CONVERT([datetime2](0), '9999-12-31 23:59:59') not null,
    UpdatedAt                       datetime2,
    C4KFamilyCaseNumber             int
) WITH (SYSTEM_VERSIONING = ON (HISTORY_TABLE = dbo.ChildHistory))
go

create index IX_Child_AuthorId
    on Child (AuthorId)
go

create index IX_Child_FamilyId
    on Child (FamilyId)
go

create index IX_Child_OrganizationId
    on Child (OrganizationId)
go

